module.exports={isPrime:e=>{if(!(e&1)||e<2)return false;const r=Math.sqrt(e);for(let t=3;t<=r;t+=2){if(e%t===0)return false}return true},findPrime:(...e)=>{const r=Array.from(new Set(e.filter(e=>Number.isInteger(e)))).sort((e,r)=>e-r);return r.reduce((e,r,t,n)=>{const s=Math.sqrt(r);if(!(r&1)||r<2){return e}else{for(let t=3;t<=s;t+=2){if(r%t===0)return e}}e.push(r);return e},[])},findPrimeInRange:(e,r)=>{const t=Number.isInteger(e)?e:2;const n=Number.isInteger(r)?r:2;const s=Math.min(t,n);const i=Math.max(t,n);let u=[];for(let e=s;e<=i;e++){const r=Math.sqrt(e);let t=false;if(!(e&1)||e<2){continue}else{for(let n=3;n<=r;n+=2){if(e%n===0){t=true;break}}if(t)continue}u.push(e)}return u}};